import { useQuery } from "react-query";

function Price({ coinId }) {
  const { isLoading, data } = useQuery<IHistorical[]>(
    ["ohlcv", coinId],
    () => fetchCoinHistory(coinId),
    { refetchInterval: 5000 }
  );
  return (
    <div>
      <h1>Price</h1>
    </div>
  );
}
export default Price;
